import React from "react"

const Note = ({ note }) => {
  return (
    <div className="note__container">
      {note.completed ? (
        <p className="note">{note.body}</p>
      ) : (
        <p className="note note--completed">{note.body}</p>
      )}
    </div>
  )
}

export default Note
